    return (
        <Fragment>
            <Button onClick={() => {
                setModalOpenStatus(true);
                // open modal to modify existing photos/images
            }} className="btn-square" color="primary-gradien" size="lg">Edit/Modify Existing Image/Photo's</Button>
            <Sheet isOpen={isOpen} onClose={() => setModalOpenStatus(false)}>
                <Sheet.Container>
                <Sheet.Header />
                <Sheet.Content>{/* Your sheet content goes here */}</Sheet.Content>
                </Sheet.Container>

                <Sheet.Backdrop />
            </Sheet>
        </Fragment>
    );
}
